    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 + - col0 IN ( col1 * + 71 - - col2 + - 62 + + 18 * - - 63 * - + col0, col1 + + col1 + + col1, + col2 );
  - name: tab2

outputs:
  - name: q6631.out
    data: |
      46	51	23
      64	77	40
      75	67	58
